import Nav from './Nav'
import HomeP from './HomeP'

const FullPemesanan = () => {
  return (
    <body className="hold-transition layout-top-nav">
      <div className="wrapper">
        <Nav/>
        <HomeP/>
      </div>
    </body>
  )
}

export default FullPemesanan
